    {ntt"total": 26,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-09-02T23:00:46.716980",nt"name": "ds-777-spatial-location-of-stream-elevations-for-the-northern-high-plains-groundwater-flow-mode",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is one of many developed
    in support of The High Plains Groundwater Availability Project and the USGS Data
    Series Report: Geodatabase Compilation of Hydrogeologic, Remote Sensing, and Water-Budget-Component
    data for the High Plains aquifer, 2011 (DS 777). This dataset contains point vector
    data from the National Hydrography Dataset Plus (NHD+) 1:100,000 stream polyline
    data converted into points and attributed with elevation values in feet above sea
    level.Streams were initially included if they had a mean estimated base flow of
    more than 10 cubic feet per second (based on streamflow data from long-term streamflow-gaging
    stations operated by the USGS or the Nebraska Department of Natural Resources).
    The stream network then was expanded to include selected streams that were deemed
    hydrogeologically important but had a mean estimated base flow of less than 10 cubic
    feet per second.",nt"license_title": null,nt"extras": [{ntt"key":
